import React, {Component} from "react"
import UserTableRow from "./UserTableRow"



    
        const UserTable = ({ users }) => {
        return (
            
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Email</th>
                        <th>AccessLevel</th>
                    </tr>
                </thead>
                  
                <tbody>
                    {this.props.users.map((user) => <UserTableRow key={user._id} user={user}/>)}
                </tbody>
            </table>      
        )
    }



export default UserTable;
